projects.description:
Journal as a Table. Manage groups, courses, students, activities and grades. 
Functionality:
- register & login;
- LastName FirstName - moderator can choose of the available users;
- add/remove columns - header of the column always date & activity;
- add/remove rows - moderator can manage rows by adding new participants;

